import React from "react";
function Row({ title, animeLista }) {
  return (
    <div className="row">
      <h2>{title}</h2>
      <div className="row">
        <div className="row_posters">
          {anime.map((anime) => (
            <a
              className="row_poster"
              href={anime.url}
              target="_blank"
              rel="noreferrer"
            >
              <figure>
                <img key={anime.rank} src={anime.image_url} alt="" />
              </figure>
              <h3>{anime.title}</h3>
            </a>
          ))}
        </div>
      </div>
    </div>
  );
}
export default Row;
